<script>
// @ is an alias to /src
import { TweenMax } from 'gsap'
import { TimelineLite } from 'gsap'
import '../../gsap-bonus/DrawSVGPlugin'
import Parallax from 'parallax-js'

export default {
  
  mounted() {
    var scene = document.getElementById('scene');
    var parallaxInstance = new Parallax(scene, {
      relativeInput: true,
      pointerEvents: true,
      selector: '.layer',
      frictionX: 0.03,
      frictionY: 0.03
    });
    
    var nxtOudenaerdeCityHall = document.querySelector('.nxtOudenaerdeCityHall');
    nxtOudenaerdeCityHall.addEventListener('click', function(){
      tlHouseLalaing.play();
    });
    var nxtHouseLalaing = document.querySelector('.nxtHouseLalaing');
    nxtHouseLalaing.addEventListener('click', function(){
      tlDrawingPeterPaul.play();
    });

    var tlCityHall = new TimelineLite();
    var tlHouseLalaing = new TimelineLite({ paused: true })
    var tlCurtains = new TimelineLite({ paused: true });
    var tlDrawingPeterPaul = new TimelineLite({ paused: true });

    // 1. on click next oudenaerde, infoOudenaerde disappears
    // 1.1 house lalaing starts to appear
    // 1.2 infoLalaing starts to appear
    // -
    // 2 on click next lalaing, infoLalaing disappears
    // 2.1 city hall and house lalaing start to disappear
    // 2.2 young rubens appears
    // 2.3 info young rubens appears

    tlCityHall.staggerFrom(".tower", 2, {drawSVG:0}, -0.1, 'tower')
    .staggerFrom(".roof", 2, {drawSVG:0}, -0.1, 'tower+=5')
    .staggerFrom(".roofTowers", 2, {drawSVG:0}, -0.1, 'tower+=7')
    .staggerFrom(".roofDeco", 2, {drawSVG:0}, -0.1, 'tower+=6')
    .staggerFrom(".topFloor", 2, {drawSVG:0}, 0.1, 'tower+=8')
    .staggerFrom(".middleFloor", 2, {drawSVG:0}, -0.1, 'tower+=9')
    .staggerFrom(".bottomFloor", 2, {drawSVG:0}, 0.1, 'tower+=12');

    tlHouseLalaing.fromTo(".infoOudenaerdeCityHall", 1, {opacity:1}, {opacity:0})
    .add( function(){ document.querySelector(".infoOudenaerdeCityHall").style.display = "none"; })
    .add( function(){ document.querySelector(".infoHouseLalaing").style.display = "block"; })
    .fromTo(".infoHouseLalaing", 1, {opacity:0}, {opacity:1})
    .staggerFrom(".door", 2, {drawSVG:0}, 0.1, 'door')
    .staggerFrom(".facade", 2, {drawSVG:0}, 0.1, 'door+=3')
    .staggerFrom(".bottomWindows", 2, {drawSVG:0}, 0.1, 'door+=4')
    .staggerFrom(".topWindows", 2, {drawSVG:0}, 0.1, 'door+=7')
    .staggerFrom(".houseRoof", 2, {drawSVG:0}, 0.1, 'door+=9');

    tlCurtains.staggerFrom(".rightCurtain", 2, {drawSVG:0}, -0.1, 'curtains')
    .staggerFrom(".leftCurtain", 2, {drawSVG:0}, -0.1, 'curtains+=1')
    .staggerFrom(".windowsill", 2, {drawSVG:0}, 0.1, 'curtains+=2')
    .staggerFrom(".window", 2, {drawSVG:0}, 0.1, 'curtains+=4');
       
    tlDrawingPeterPaul.fromTo(".infoHouseLalaing", 1, {opacity:1}, {opacity:0})
    .add( function(){ document.querySelector(".infoHouseLalaing").style.display = "none"; })
    .add( function(){ document.querySelector(".infoDrawingPeterPaul").style.display = "block"; })
    .fromTo(".houseLalaing", 2, {opacity:1}, {opacity:0}, 'lalaing')
    .fromTo(".oudenaerdeCityHall", 2, {opacity:1}, {opacity:0}, 'lalaing+=1')
    .fromTo(".infoDrawingPeterPaul", 1, {opacity:0}, {opacity:1})
    .add( function(){ document.querySelector(".drawingPeterPaul").style.display = "block"; })
    .add( function(){ tlCurtains.play(); })
    .staggerFrom(".rightHand", 2, {drawSVG:0}, 0.1, 'hands')
    .staggerFrom(".leftHand", 2, {drawSVG:0}, 0.1, 'hands+=1')
    .staggerFrom(".rightArm", 2, {drawSVG:0}, -0.1, 'hands+=1')
    .staggerFrom(".leftArm", 2, {drawSVG:0}, -0.1, 'hands+=2')
    .staggerFrom(".clothes", 2, {drawSVG:0}, 0.1, 'hands+=4')
    .staggerFrom(".chair", 2, {drawSVG:0}, 0.1, 'hands+=5')
    .staggerFrom(".collar", 2, {drawSVG:0}, 0.1, 'hands+=4')
    .staggerFrom(".face", 2, {drawSVG:0}, 0.1, 'hands+=5')
    .staggerFrom(".eye", 2, {drawSVG:0}, 0.1, 'hands+=6')
    .staggerFrom(".hair", 2, {drawSVG:0}, 0.1, 'hands+=6')
    .staggerFrom(".tableTop", 2, {drawSVG:0}, 0.1, 'hands+=2')
    .staggerFrom(".book", 2, {drawSVG:0}, 0.1, 'hands+=6');
    
  }
}
